import React from 'react';

const Footer = () => {
    return (
        <section className="row">
            
           <div>
           <div className="bg-success d-flex col-md-3 col-sm-6">
                <p>asasas</p>

            </div>
            <div className="bg-dark d-flex col-md-3 col-sm-6">
            <p>asasas</p>
            </div>

            <div d-flex col-md-3 col-sm-6>
            <p>asasas</p>

            </div>
            <div className="bg-success d-flex col-md-3 col-sm-6">
            <p>asasas</p>
            </div>
           </div>
        </section>
    );
};

export default Footer;
